@font-face {
	font-family: monument;
	src: url(../fonts/monument/MonumentExtended-Bold.otf);
	font-weight: bold;
}

@font-face {
	font-family: opensans;
	src: url(../fonts/opensans/OpenSans-Bold.ttf);
	font-weight: bold;
}

@font-face {
	font-family: opensans;
	src: url(../fonts/opensans/OpenSans-BoldItalic.ttf);
	font-weight: 700;
}

@font-face {
	font-family: opensans;
	src: url(../fonts/opensans/OpenSans-ExtraBold.ttf);
	font-weight: 800;
}

@font-face {
	font-family: opensans;
	src: url(../fonts/opensans/OpenSans-ExtraBoldItalic.ttf);
	font-weight: 900;
}

@font-face {
	font-family: opensans;
	src: url(../fonts/opensans/OpenSans-Italic.ttf);
	font-weight: 100;
}

@font-face {
	font-family: opensans;
	src: url(../fonts/opensans/OpenSans-LightItalic.ttf);
	font-weight: 150;
}

@font-face {
	font-family: opensans;
	src: url(../fonts/opensans/OpenSans-Regular.ttf);
	font-weight: 200;
}

@font-face {
	font-family: opensans;
	src: url(../fonts/opensans/OpenSans-SemiBold.ttf);
	font-weight: 300;
}

@font-face {
	font-family: opensans;
	src: url(../fonts/opensans/OpenSans-SemiBoldItalic.ttf);
	font-weight: 350;
}

*,
*::after,
*::before {
	box-sizing: border-box;
}

:root {
	font-size: 16px;
}

*, body, html,
h1, h2, h3, h4, h5,
a, p, ul, a, button {
	margin: 0;
	padding: 0;
	list-style: none;
	text-decoration: none;
	box-sizing: border-box;
}

body {
	margin: 0;
	--color-text: #a5a5a5;
	--color-bg: #191613;
	--color-link: #d6af7c;
	--color-link-hover: #fff;
	--color-text-circle-1: #48423c;
	--color-text-circle-2: #48423c;
	--color-text-circle-3: #48423c;
	--color-text-circle-4: #48423c;
	--font-circle-1: ivymode, sans-serif;
	--font-weight-circle-1: 300;
	--font-circle-2: modesto-condensed, serif;
	--font-weight-circle-2: 400;
	--font-circle-3: minerva-modern, sans-serif;
	--font-weight-circle-3: 400;
	--font-circle-4: niagara, serif;
	--font-weight-circle-4: 300;
	--color-button: #d6ae7c;
	--color-text-button: #1d1812;
	--dim-button: 90px;
	color: var(--color-text);
	background-color: var(--color-bg);
	font-family: tenon, sans-serif;
	-webkit-font-smoothing: antialiased;
	-moz-osx-font-smoothing: grayscale;
	font-family: opensans, Arial, Helvetica, sans-serif;
	font-weight: 200;
}

.demo-2 {
	--color-text: #a5a5a5;
	--color-bg: #000000;
	--color-link: #ea34a6;
	--color-link-hover: #fff;
	--color-font-circle: #7b7772;
	--color-button: #ea34a6;
	--color-text-button: #000000;
	--color-text-circle-1: #ea34a6;
	--color-text-circle-2: #422163;
	--color-text-circle-3: #212044;
	--color-text-circle-4: #292725;
	--font-circle-1: niagara, serif;
	--font-weight-circle-1: 300;
	--font-circle-2: ambroise-firmin-std, serif;
	--font-weight-circle-2: 300;
	--font-circle-3: modesto-condensed, serif;
	--font-weight-circle-3: 400;
	--font-circle-4: niagara, serif;
	--font-weight-circle-4: 300;
}

.demo-3 {
	--color-text: #292725;
	--color-bg: #dad4d1;
	--color-link: #a99c90;
	--color-link-hover: #292725;
	--color-font-circle: #7b7772;
	--color-button: #a99c90;
	--color-text-button: #272524;
	--color-text-circle-1: #272524;
	--color-text-circle-2: #272524;
	--color-text-circle-3: #272524;
	--color-text-circle-4: #272524;
	--font-circle-1: modesto-condensed, serif;
	--font-weight-circle-1: 400;
	--font-circle-2: ambroise-firmin-std, serif;
	--font-weight-circle-2: 300;
	--font-circle-3: modesto-condensed, serif;
	--font-weight-circle-3: 400;
	--font-circle-4: niagara, sans-serif;
	--font-weight-circle-4: 300;
}

/* Page Loader */
.js body::before,
.js body::after {
	content: '';
	position: fixed;
	z-index: 1000;
	transition: opacity 0.3s;
	opacity: 0;
	pointer-events: none;
}

.js body::before {
	top: 0;
	left: 0;
	width: 100%;
	height: 100%;
	background: var(--color-bg);
}

.js body::after {
	content: 'Loading';
	top: 0;
	left: 0;
	width: 100%;
	height: 100%;
	display: flex;
	align-items: center;
	justify-content: center;
	font-weight: 500;
	line-height: 1;
	color: var(--color-link);
}

.js .loading::before,
.js .loading::after {
	opacity: 1;
	pointer-events: auto;
}

a {
	text-decoration: none;
	color: var(--color-link);
	outline: none;
}

a:hover {
	color: var(--color-link-hover);
	outline: none;
}

/* Better focus styles from https://developer.mozilla.org/en-US/docs/Web/CSS/:focus-visible */
a:focus {
	/* Provide a fallback style for browsers
	 that don't support :focus-visible */
	outline: none;
	background: lightgrey;
}

a:focus:not(:focus-visible) {
	/* Remove the focus indicator on mouse-focus for browsers
	 that do support :focus-visible */
	background: transparent;
}

a:focus-visible {
	/* Draw a very noticeable focus style for
	 keyboard-focus on browsers that do support
	 :focus-visible */
	outline: 2px solid red;
	background: transparent;
}

.frame {
	padding: 3rem 5vw;
	text-align: center;
	position: relative;
	font-weight: 500;
	will-change: transform;
}

.js .frame {
	opacity: 0;
}

.frame__title {
	font-size: 1rem;
	margin: 0 0 1rem;
	font-weight: 500;
}

.frame__links {
	display: inline;
}

.frame__links a:not(:last-child),
.frame__demos a:not(:last-child) {
	margin: 0 1rem 0 0;
}

.frame__demos {
	margin: 1rem 0;
}

.frame__demo--current,
.frame__demo--current:hover {
	color: var(--color-text);
}

.enter {
	display: block;
	border: 0;
	width: var(--dim-button);
	height: var(--dim-button);
	position: absolute;
	left: calc(50% - var(--dim-button) / 2 );
	top: calc(50% - var(--dim-button) / 2 );
	font: inherit;
	font-weight: 500;
	cursor: pointer;
	background: none;
	color: var(--color-text-button);
	padding: 0;
}

.enter:focus,
.enter:hover,
.enter:active {
	outline: none;
}

.enter__bg {
	position: absolute;
	top: 0;
	left: 0;
	width: 100%;
	height: 100%;
	border-radius: 50%;
	background: #272524;
}

.enter__text {
	position: relative;
	color: #FFF;
}

.js .enter {
	opacity: 0;
}

.content {
	display: flex;
	flex-direction: column;
	width: 100vw;
	padding: 2rem;
	height: calc(100vh - 13rem);
	position: relative;
	justify-content: flex-start;
	align-items: center;
	text-align: center;
	margin-top: 100px;
}

.js .content {
	opacity: 0;
}

.content .wrapper-scrolling {
	position: fixed;
    top: -30px;
    right: 0;
    bottom: 0;
    left: 0;
    margin: auto;
	width: 85%;
    max-width: 500px;
    z-index: 10;
    text-align: center;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    transform: none !important;
}

.content .wrapper-scrolling .title {
	font-family: monument;
	font-weight: bold;
	font-size: 35px;
	color: #46310D;
	margin-bottom: -20px;
}

@media screen and (max-width: 500px) {
	.content .wrapper-scrolling .title {
		font-size: 26px;
	}
}

.content .wrapper-scrolling .container-image {
	width: 100%;
    max-width: 450px;
	height: auto;
	opacity: .85;
}

.content .wrapper-scrolling .container-image .image {
	width: 100%;
	height: 100%;
	object-fit: contain;
}

.content .wrapper-scrolling .scroll {
	border: 1px solid #FFFFFF;
    padding: 20px 35px;
    border-radius: 50px;
    background-color: rgba(0, 0, 0, .32);
    margin-top: -10px;
    position: relative;
    display: flex;
    align-items: center;
    justify-content: center;
	margin-top: -15px;
}

.content .wrapper-scrolling .scroll::before {
	content: '';
	background-image: url(../image/icon-scroll.svg);
	background-size: contain;
	background-repeat: no-repeat;
	background-position: center center;
    width: 42px;
    height: 30px;
    display: block;
	animation: 1.15s animation-scrolling infinite alternate;
}

@keyframes animation-scrolling {
	0% {
		transform: translateY(-3px);
	}
	100% {
		transform: translateY(5px);
	}
}

.content .wrapper-scrolling .scroll .text {
	font-size: 21px;
	color: #FFFFFF;
}

@media screen and (max-width: 500px) {
	.content .wrapper-scrolling .scroll .text {
		font-size: 16px;
	}
}

.content p {
	font-size: 2rem;
	font-size: clamp(1.25rem,6vw,2.15rem);
	line-height: 1.25;
	max-width: 900px;
	margin: 0;
	pointer-events: none;
	will-change: transform;
}

.circles {
	pointer-events: none;
	position: fixed;
	 --dim: 186vmin;
	width: var(--dim);
	height: var(--dim);
	top: calc(50% - var(--dim) / 2 );
	left: calc(50% - var(--dim) / 2 );
	background-color: #CBB663;
}

.demo-3 .circles {
	--dim: 206vmin;
}

.circles__text {
	text-transform: uppercase;
	transform-origin: 700px 700px;
	will-change: transform, opacity;
}

.circles__text--1 {
	font-size: 25vmin;
	font-size: clamp(170px,25vmin,180px);
	font-family: var(--font-circle-1);
	font-weight: var(--font-weight-circle-1);
	fill: var(--color-text-circle-1);
}

.circles__text--2 {
	font-size: 17vmin;
	font-size: clamp(136px,17vmin,153px);
	font-family: var(--font-circle-2);
	font-weight: var(--font-weight-circle-2);
	fill: var(--color-text-circle-2);
}

.circles__text--3 {
	font-size: 13.5vmin;
	font-size: clamp(110px,13.5vmin,120px);
	font-family: var(--font-circle-3);
	font-weight: var(--font-weight-circle-3);
	fill: var(--color-text-circle-3);
}

.circles__text--4 {
	font-size: 9.5vmin;
	font-size: clamp(85px,9.5vmin,94px);
	font-family: var(--font-circle-4);
	font-weight: var(--font-weight-circle-4);
	fill: var(--color-text-circle-4);
}

@media screen and (min-width: 53em) {
	.frame {
		position: fixed;
		text-align: left;
		z-index: 100;
		top: 0;
		left: 0;
		display: grid;
		align-content: space-between;
		width: 100%;
		max-width: none;
		height: 100vh;
		padding: 2rem;
		pointer-events: none;
		grid-template-columns: 50% 50%;
		grid-template-rows: auto auto auto;
		grid-template-areas: 'title links'
							'... ...'
							'... demos';
	}
	.frame__title {
		margin: 0;
		grid-area: title;
	}
	.frame__menu {
		grid-area: menu;
		justify-self: end;
	}
	.frame__links {
		grid-area: links;
		padding: 0;
		justify-self: end;
	}
	.frame__demos {
		margin: 0;
		grid-area: demos;
		justify-self: end;
	}
	.frame a {
		pointer-events: auto;
	}
	.content {
		height: 100vh;
		justify-content: center;
		text-align: left;
	}
}

