    height: 100px;
	display: flex;
    align-items: center;
    justify-content: center;
	z-index: 1;
}

.highlight::before {
	content: "";
    display: block;
    position: relative;
    width: 15px;
    height: 15px;
    border-radius: 50%;
    inset: 0 0 0 0;
    margin: auto;
    background-color: rgb(255, 255, 255);
}

.highlight::after {
	content: "";
    display: block;
    position: absolute;
    width: 50px;
    height: 50px;
    border-radius: 50%;
    inset: 0px;
    margin: auto;
    background-color: transparent;
    box-shadow: rgb(255 255 255) 2px 2px 15px;
    animation: 1.85s ease 0s infinite alternate-reverse none running animation-spot;
}

@media screen and (max-width: 480px) {
	.highlight {
		width: 50px;
    	height: 50px;
	}

